import { useQuiz } from "../contexts/QuizContext";


export default function Prevbutton(){
    const { dispatch, answer, index, numQuestions } = useQuiz();

return(
    <button
        className="btn btn-ui"
        onClick={() => dispatch({ type: "finish" })}
      >
        Prev
      </button>
)
};
